\"metadata\":{\"contentType\":\"Imagen\",\"license\":\"U\",\"title\":\"Sin ttulo Imagen\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":4.958677685950414,\"y\":5.2239610031311114,\"width\":90.9090909090909,\"height\":94.68429318175139,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p></p>\\n\\n<p><span style=\\\"color:#ffffff\\\"><span style=\\\"font-size:1.25em\\\">Antes de iniciar este curso de STEM para Educacin Especial, le invitamos a completar una breve evaluacin diagnstica que nos permitir conocer mejor su nivel de familiaridad y experiencia en temas de Ciencia, Tecnologa, Ingeniera y Matemticas (STEM). Este cuestionario tambin ayudar a identificar sus necesidades especficas en cuanto a metodologas y herramientas adaptadas para la enseanza de STEM a estudiantes con necesidades especiales.</span></span></p>\\n\\n<p><span style=\\\"color:#ffffff\\\"><span style=\\\"font-size:1.25em\\\"><strong>Instrucciones:</strong></span></span></p>\\n\\n<ul>\\n\\t<li><span style=\\\"color:#ffffff\\\"><span style=\\\"font-size:1.25em\\\">Responda cada pregunta seleccionando la opcin que mejor describa su nivel actual de conocimiento o experiencia.</span></span></li>\\n\\t<li><span style=\\\"color:#ffffff\\\"><span style=\\\"font-size:1.25em\\\">No se preocupe si no tiene conocimiento en algunos temas, ya que el curso est diseado para enriquecer sus habilidades independientemente de su nivel inicial.</span></span></li>\\n</ul>\\n\"},\"subContentId\":\"e7efea94-0257-451d-b76e-81fac17d8fd7\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin ttulo Texto\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"key \n\",\"<p>Se enfoca nicamente en el uso de computadoras y software en el aula</p>\\n\"]},{\"subContentId\":\"53e08b01-7778-42ef-ad80-b89157fd8dfe\",\"question\":\"<p><strong>5. Cul es el concepto de iteracin en programacin y su importancia en STEM?</strong></p>\\n\",\"answers\":[\"<p>Es repetir una serie de pasos hasta que se cumpla una condicin</p>\\n\",\"<p>Es una funcin matemtica que se aplica solo en clculo</p>\\n\",\"<p>Es un mtodo de resolucin de problemas que se usa solo en lgebra</p>\\n\"]},{\"subContentId\":\"1c64be95-7f77-45df-b032-d5ea8c50bf61\",\"question\":\"<p><strong>6. Qu significa el enfoque de aprendizaje basado en proyectos dentro del contexto de STEM?</strong></p>\\n\",\"answers\":[\"<p>Disear y resolver problemas del mundo real mediante proyectos colaborativos</p>\\n\",\"<p>Trabajar en actividades independientes sin conexin entre s</p>\\n\",\"<p>Realizar nicamente ejercicios de laboratorio de ciencias</p>\\n\"]},{\"subContentId\":\"c64f9115-66d6-4655-b034-9b238f5b4e49\",\"question\":\"<p><strong>7. En el contexto de STEM, cul es el propsito del pensamiento computacional?</strong></p>\\n\",\"answers\":[\"<p>Ensear a los estudiantes a descomponer problemas complejos en pasos simples y secuenciales</p>\\n\",\"<p>Ayudar a los estudiantes a aprender sobre computadoras y programacin</p>\\n\",\"<p>Practicar habilidades de memoria y repeticin.</p>\\n\"]},{\"subContentId\":\"f851bb57-b473-47e5-95b5-7591d5538afd\",\"question\":\"<p><strong>8. De las siguientes opciones, Qu herramientas tecnolgicas o aplicaciones especficas de STEM consideras que pueden ayudarte en tus clases?</strong></p>\\n\",\"answers\":[\"<p>Herramientas avanzadas como robtica, impresoras 3D y software especializado en educacin especial.</p>\\n\",\"<p>Herramientas bsicas como calculadoras y presentaciones digitales.</p>\\n\",\"<p>Aplicaciones de programacin y simuladores (p. ej., Scratch, simuladores de ciencias)</p>\\n\"]}],\"overallFeedback\":[{\"from\":0,\"to\":100}],\"behaviour\":{
